    filterMarkers = function (category) {
      if (category === "gym") {
          map.panTo(new google.maps.LatLng(59.959552, 30.600739));
          map.setZoom(12);
        }
      if (category === "bycicle") {
          map.panTo(new google.maps.LatLng(59.962978, 30.558075));
          map.setZoom(13);
        }
      if (category === "workout") {
          map.panTo(new google.maps.LatLng(59.954469, 30.579338));
          map.setZoom(14);
        }
      if (category === "string") {
          map.panTo(new google.maps.LatLng(59.925271, 30.737712));
          map.setZoom(13);
        }
      if (category === "fun") {
          map.panTo(new google.maps.LatLng(59.959552, 30.600739));
          map.setZoom(12);
        }
      if (category === "horse") {
          map.panTo(new google.maps.LatLng(59.945806, 30.620517));
          map.setZoom(13);
        }
      if (category === "spa") {
          map.panTo(new google.maps.LatLng(59.959552, 30.600739));
          map.setZoom(13);
        }
      if (category === "healthfood") {
          map.panTo(new google.maps.LatLng(59.946727, 30.477768));
          map.setZoom(13);
        }
      if (category === "park") {
          map.panTo(new google.maps.LatLng(59.959552, 30.600739));
          map.setZoom(13);
        }
      if (category === "ski") {
          map.panTo(new google.maps.LatLng(59.958742, 30.475075));
          map.setZoom(13);
        }
      if (category == "") {
            map.setZoom(12);
      }

      
        gmarkers1.map((marker) => {
            if (marker.category == category || category.length === 0 || marker.category == "logo") {
                marker.setVisible(true);
            }
            else {
                marker.setVisible(false);
            }
        });
    }
    function moveToLocation(){
        map.panTo(new google.maps.LatLng(59.959552, 30.600739));
        gmarkers1.map((marker) => {
            marker.setVisible(true);
        });
    }

    // Запуск карты
    initMap();

    var windowWidth = $(window).width();

    $(window).on('resize', function(){
      windowWidth = $(window).width();
    });

    $(document).on("click",".legend-item",function(e){
        if ( windowWidth < 768 ) {
            $('.legend-item').removeClass('active');
            $(this).addClass('active');

            $('.map-legend').addClass('hidden');
            $('.map-legend-mob').addClass('hidden');

            var text = $(this).attr("data-filter-map");
            if(text) filterMarkers(text);
            else moveToLocation();
            return false;
        } else {
            $('.legend-item').removeClass('active');
            $(this).addClass('active');
            $('.legend-item_all').animate({
                  height: '45px'
            });

            var text = $(this).attr("data-filter-map");


            if(text) filterMarkers(text);
            else moveToLocation();
            return false;
        }
    });

    $(document).on('click', '.legend-item_all', function(){
      if (windowWidth > 768) {
            $('.legend-item_all').animate({
                  height: '0'
            });
      }
    });

    $(document).on('click', '.map-legend-mob', function() {
      if($(this).hasClass('hidden')) {
            $(document).find('.map-legend').removeClass('hidden');
            $(this).removeClass('hidden');
            return false;
      } else {
            $(document).find('.map-legend').addClass('hidden');
            $(this).addClass('hidden');
            return false; 
      }
    });
